import React, { Fragment } from "react";
import Button from "../Button/Button";
import "./Card.css";
import useDataApi from "../../service/useDataApi";
import { useCountDown } from "../../service/useCountDown";

const Card = () => {
  const { result } = useDataApi();
  return (
    <>
      {result.map(
        ({
          id,
          imageUrl,
          amount,
          remainingTime,
          make,
          version,
          model,
          year,
          km,
        }) => (
          <Fragment key={id}>
            <div className="card">
              <div className="container-2">
                <img src={imageUrl} alt="people" />
                <span>ver detalhes</span>
              </div>

              <div class="parent">
                <div class="div1">
                  <span>tempo restante</span>
                  <span>{useCountDown(remainingTime)}</span>
                </div>
                <div class="div2">
                  <span>Ãºltima oferta</span>
                  <div class="divider"></div>
                  <span>{amount}</span>
                </div>
                <div class="div3">
                  {`${make} 
                  ${model} 
                  ${version} 
                  ${year} `}
                </div>
                <div class="div4">{year}</div>

                <div class="div5">
                  <span>{km}</span>
                  <div class="divider"></div>
                </div>
                <div class="div6">
                  <Button />
                </div>
              </div>
            </div>
          </Fragment>
        )
      )}
    </>
  );
};

export default Card;
